// src/pages/Users.js

import React, { useState, useEffect } from 'react';
import api from '../services/api'; // Senin api dosyanın yolu
import { FiMail, FiUser, FiSearch } from 'react-icons/fi';

function Users() {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      // Backend'inde '/users' endpoint'i olduğunu varsayıyorum.
      // Eğer farklıysa burayı güncellemelisin (örn: '/admin/users')
      const response = await api.get('/users'); 
      setUsers(response.data);
    } catch (err) {
      console.error("Users couldn't get pulled!:", err);
      setError("An error occured while trying to get users!");
    } finally {
      setLoading(false);
    }
  };

  if (loading) return <div className="p-6 text-gray-400">Loading...</div>;
  if (error) return <div className="p-6 text-red-400">{error}</div>;

  return (
    <div className="container mx-auto max-w-5xl">
      <div className="mb-6 flex justify-between items-center">
        <h1 className="text-2xl font-bold text-white">Users</h1>
        <div className="text-sm text-gray-400">
          Total: <span className="text-white font-bold">{users.length}</span> Register
        </div>
      </div>

      <div className="bg-gray-800 rounded-xl overflow-hidden border border-gray-700 shadow-lg">
        <div className="overflow-x-auto">
          <table className="w-full text-left text-gray-300">
            <thead className="bg-gray-900/50 text-xs uppercase text-gray-400 font-semibold">
              <tr>
                <th className="px-6 py-4">Username</th>
                <th className="px-6 py-4">Email</th>
                <th className="px-6 py-4">Role</th>
                <th className="px-6 py-4 text-right">Register Date</th>
              </tr>
            </thead>
            <tbody className="divide-y divide-gray-700">
              {users.map((user) => (
                <tr key={user.id} className="hover:bg-gray-700/50 transition-colors">
                  <td className="px-6 py-4">
                    <div className="flex items-center">
                      <div className="w-8 h-8 rounded-full bg-blue-600 flex items-center justify-center text-white font-bold mr-3 text-xs">
                        {user.username.charAt(0).toUpperCase()}
                      </div>
                      <span className="font-medium text-white">{user.username}</span>
                    </div>
                  </td>
                  <td className="px-6 py-4">
                    <div className="flex items-center text-sm">
                      <FiMail className="mr-2 text-gray-500" />
                      {user.email}
                    </div>
                  </td>
                  <td className="px-6 py-4">
                     <span className={`text-xs px-2 py-1 rounded border ${user.role === 'admin' ? 'border-red-500 text-red-400 bg-red-500/10' : 'border-blue-500 text-blue-400 bg-blue-500/10'}`}>
                        {user.role}
                     </span>
                  </td>
                  <td className="px-6 py-4 text-right text-sm text-gray-500 font-mono">
                    {new Date(user.created_at || Date.now()).toLocaleDateString()}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
        
        {users.length === 0 && (
          <div className="p-8 text-center text-gray-500">
            No registered user found!
          </div>
        )}
      </div>
    </div>
  );
}

export default Users;
